sys_variable_value.value:
(function execute(inputs, outputs) {
  var requestBody = {};
  for (var property in inputs) {
    if (!gs.nil(inputs[property])) {
      requestBody[property] = inputs[property];
    }
  }
  outputs.request_body = JSON.stringify(requestBody);
})(inputs, outputs);

